    setTimeout(() => {
        const layerControlLabels = document.querySelectorAll('.leaflet-control-layers-overlays label');

        const selectAllLabel = document.createElement('label');
        const selectAllCheckbox = document.createElement('input');
        selectAllCheckbox.type = 'checkbox';
        selectAllCheckbox.checked = true;
        selectAllCheckbox.style.marginRight = '4px';
        selectAllLabel.appendChild(selectAllCheckbox);
        selectAllLabel.append("Select All");
        layerControlDiv.insertBefore(selectAllLabel, layerControlDiv.firstChild);

        selectAllCheckbox.addEventListener('change', () => {
            layerControlLabels.forEach(label => {
                const checkbox = label.querySelector('input');
                if (checkbox && checkbox.checked !== selectAllCheckbox.checked) {
                    checkbox.click();
                }
            });
        });
    }, 1000);
</script>
